<polygon fill="none" stroke="#000000" points="2291,-2917.5 2291,-2948.5 2637,-2948.5 2637,-2917.5 2291,-2917.5"/>
<polygon fill="#d3d3d3" stroke="transparent" points="2294,-2920.5 2294,-2945.5 2634,-2945.5 2634,-2920.5 2294,-2920.5"/>
<text text-anchor="start" x="2446.5" y="-2930.5" font-size="0.6em" fill="#0000ff">Boiling</text>
<polygon fill="none" stroke="#000000" points="2291,-2811.5 2291,-2917.5 2637,-2917.5 2637,-2811.5 2291,-2811.5"/>
<text text-anchor="start" x="2301" y="-2857.5" font-size="0.6em" fill="#696969">skos:definition</text>
<text text-anchor="start" x="2385.5" y="-2890.5" font-size="0.6em" fill="#000000">After the wort has been extracted from the malt,</text>
<text text-anchor="start" x="2386" y="-2879.5" font-size="0.6em" fill="#000000">it is necessary to boil the wort before fermation.</text>
<text text-anchor="start" x="2386" y="-2868.5" font-size="0.6em" fill="#000000">Boiling does a number of things to the malt such</text>
<text text-anchor="start" x="2401.5" y="-2857.5" font-size="0.6em" fill="#000000">as: sterilization, enzyme denaturing, color</text>
<text text-anchor="start" x="2398.5" y="-2846.5" font-size="0.6em" fill="#000000">development, increasing the concentration,</text>
<text text-anchor="start" x="2383" y="-2835.5" font-size="0.6em" fill="#000000">secondary products are distilled and oxidized and</text>
<text text-anchor="start" x="2384.5" y="-2824.5" font-size="0.6em" fill="#000000">finally hop aromas are extracted and isomerized.</text>
</g>

<g id="node110" class="node">

<polygon fill="none" stroke="#000000" points="2289,-3318.5 2289,-3349.5 2640,-3349.5 2640,-3318.5 2289,-3318.5"/>
<polygon fill="#d3d3d3" stroke="transparent" points="2292,-3321.5 2292,-3346.5 2637,-3346.5 2637,-3321.5 2292,-3321.5"/>
<text text-anchor="start" x="2447.5" y="-3331.5" font-size="0.6em" fill="#0000ff">Milling</text>
<polygon fill="none" stroke="#000000" points="2289,-3201.5 2289,-3318.5 2640,-3318.5 2640,-3201.5 2289,-3201.5"/>
<text text-anchor="start" x="2299" y="-3253" font-size="0.6em" fill="#696969">skos:definition</text>
<text text-anchor="start" x="2381" y="-3291.5" font-size="0.6em" fill="#000000">The process by which malts are converted to grist.</text>
<text text-anchor="start" x="2390.5" y="-3280.5" font-size="0.6em" fill="#000000">To increase the surface area of the malts, they</text>
<text text-anchor="start" x="2389" y="-3269.5" font-size="0.6em" fill="#000000">are milled and then hot water is applied so that</text>
<text text-anchor="start" x="2435" y="-3258.5" font-size="0.6em" fill="#000000">the starch can be extracted. </text>
<text text-anchor="start" x="2381.5" y="-3247.5" font-size="0.6em" fill="#000000">The grist cannot be too coarse or else the some of</text>
<text text-anchor="start" x="2393" y="-3236.5" font-size="0.6em" fill="#000000">the starches will not be released. Nor can the</text>
<text text-anchor="start" x="2390.5" y="-3225.5" font-size="0.6em" fill="#000000">grist be too fine or a paste will form and water</text>
<text text-anchor="start" x="2424" y="-3214.5" font-size="0.6em" fill="#000000">will not be able to drain properly.</text>
</g>

<polygon fill="none" stroke="#000000" points="1143.5,-5415.5 1143.5,-5640.5 1493.5,-5640.5 1493.5,-5415.5 1143.5,-5415.5"/>
<text text-anchor="start" x="1153.5" y="-5613.5" font-size="0.6em" fill="#696969">foaf:name</text>
<text text-anchor="start" x="1235.5" y="-5613.5" font-size="0.6em" fill="#000000">Pale Ale</text>
<text text-anchor="start" x="1153.5" y="-5511" font-size="0.6em" fill="#696969">skos:definition</text>
<text text-anchor="start" x="1247.5" y="-5593.5" font-size="0.6em" fill="#000000">Pale Ales are a style of beer that are typically</text>
<text text-anchor="start" x="1242" y="-5582.5" font-size="0.6em" fill="#000000">light in color, have stong hop flavors, and low in</text>
<text text-anchor="start" x="1236" y="-5571.5" font-size="0.6em" fill="#000000">alcohol content. This umbrella term includes IPAs,</text>
<text text-anchor="start" x="1254" y="-5560.5" font-size="0.6em" fill="#000000">APAs and English pale ales. Most Pale Ales</text>
<text text-anchor="start" x="1253.5" y="-5549.5" font-size="0.6em" fill="#000000">are english&#45;style, since it has become quite</text>
<text text-anchor="start" x="1249" y="-5538.5" font-size="0.6em" fill="#000000">popular, many countries developed their own</text>
<text text-anchor="start" x="1238" y="-5527.5" font-size="0.6em" fill="#000000">versions of pale ales that originated from English</text>
<text text-anchor="start" x="1240.5" y="-5516.5" font-size="0.6em" fill="#000000">style of brewing beer. Samuel Allsopp in Burton,</text>
<text text-anchor="start" x="1235.5" y="-5505.5" font-size="0.6em" fill="#000000">UK brewed the first pale ale for the Indian market</text>
<text text-anchor="start" x="1238.5" y="-5494.5" font-size="0.6em" fill="#000000">in 1822 and it was shipped in 1823 to India which</text>
<text text-anchor="start" x="1253.5" y="-5483.5" font-size="0.6em" fill="#000000">had a lasting impact that lead to the rise of</text>
<text text-anchor="start" x="1254.5" y="-5472.5" font-size="0.6em" fill="#000000">India Pale Ales. Pale ales used to be called</text>
<text text-anchor="start" x="1245.5" y="-5461.5" font-size="0.6em" fill="#000000">&quot;bitter ales&quot; in the past but now it has become</text>
<text text-anchor="start" x="1249.5" y="-5450.5" font-size="0.6em" fill="#000000">three versions being &quot;ordinary&quot; that range in</text>
<text text-anchor="start" x="1247.5" y="-5439.5" font-size="0.6em" fill="#000000">3%&#45;4% ABV, &quot;special&quot; and &quot;extra special&quot; that</text>
<text text-anchor="start" x="1314" y="-5428.5" font-size="0.6em" fill="#000000">range 4.5&#45;5% ABV.</text>
</g>

<text text-anchor="start" x="1797.5" y="-6696.5" font-size="0.6em" fill="#0000ff">Ale</text>
<text text-anchor="start" x="1922" y="-6696.5" font-size="0.6em" fill="#000000">rdfs:Class, owl:Class</text>
<polygon fill="none" stroke="#000000" points="1737.5,-6491.5 1737.5,-6683.5 2084.5,-6683.5 2084.5,-6491.5 1737.5,-6491.5"/>
<text text-anchor="start" x="1747.5" y="-6590.5" font-size="0.6em" fill="#696969">skos:definition</text>
<text text-anchor="start" x="1836" y="-6656.5" font-size="0.6em" fill="#000000">The main distinguishing feature of an ale is the</text>
<text text-anchor="start" x="1848" y="-6645.5" font-size="0.6em" fill="#000000">type of yeast used in the brewing process,</text>
<text text-anchor="start" x="1830.5" y="-6634.5" font-size="0.6em" fill="#000000">Saccharomyces cerevisiae. S. cerevisiae typically</text>
<text text-anchor="start" x="1837.5" y="-6623.5" font-size="0.6em" fill="#000000">prefers a warmer brewing range and lacks the</text>
<text text-anchor="start" x="1851" y="-6612.5" font-size="0.6em" fill="#000000">ability to metabolize the complex sugars:</text>
<text text-anchor="start" x="1849.5" y="-6601.5" font-size="0.6em" fill="#000000">melibiose and raffinose. Ales are typically</text>
<text text-anchor="start" x="1840.5" y="-6590.5" font-size="0.6em" fill="#000000">fermented, depending of course on the strain</text>
<text text-anchor="start" x="1835" y="-6579.5" font-size="0.6em" fill="#000000">yeast, at 16&#45;24˚C (60&#45;75˚F) temperature range.</text>
<text text-anchor="start" x="1840.5" y="-6568.5" font-size="0.6em" fill="#000000">Which is typically, but not exclusively, warmer</text>
<text text-anchor="start" x="1829.5" y="-6557.5" font-size="0.6em" fill="#000000">than lager fermentation. Ales also do not undergo</text>
<text text-anchor="start" x="1844.5" y="-6546.5" font-size="0.6em" fill="#000000">a cold&#45;conditioning phase. However it is not</text>
<text text-anchor="start" x="1831.5" y="-6535.5" font-size="0.6em" fill="#000000">uncommon for some lagers to not undergo a cold</text>
<text text-anchor="start" x="1935.5" y="-6524.5" font-size="0.6em" fill="#000000">phase.</text>
<text text-anchor="start" x="1747.5" y="-6504.5" font-size="0.6em" fill="#696969">foaf:name</text>
<text text-anchor="start" x="1829.5" y="-6504.5" font-size="0.6em" fill="#000000">Ale</text>
</g>

<g id="node154" class="node">
<title>https://rdf.ag/o/beer#Mead</title>
<polygon fill="none" stroke="#000000" points="2284,-1645.5 2284,-1676.5 2644,-1676.5 2644,-1645.5 2284,-1645.5"/>
<polygon fill="#d3d3d3" stroke="transparent" points="2287,-1648.5 2287,-1673.5 2641,-1673.5 2641,-1648.5 2287,-1648.5"/>
<text text-anchor="start" x="2328.5" y="-1658.5" font-size="0.6em" fill="#0000ff">Honey Wine Mead</text>
<text text-anchor="start" x="2497" y="-1658.5" font-size="0.6em" fill="#000000">owl:Class, rdfs:Class</text>
<polygon fill="none" stroke="#000000" points="2284,-1488.5 2284,-1645.5 2644,-1645.5 2644,-1488.5 2284,-1488.5"/>
<text text-anchor="start" x="2294" y="-1607.5" font-size="0.6em" fill="#696969">rdfs:comment</text>
<text text-anchor="start" x="2386" y="-1618.5" font-size="0.6em" fill="#000000">Mead is not technically a beer since its primary</text>
<text text-anchor="start" x="2376" y="-1607.5" font-size="0.6em" fill="#000000">source of sugar comes from honey, but for the sake</text>
<text text-anchor="start" x="2382" y="-1596.5" font-size="0.6em" fill="#000000">of convenience this class is in the Beer Ontology.</text>
<text text-anchor="start" x="2294" y="-1576.5" font-size="0.6em" fill="#696969">foaf:name</text>
<text text-anchor="start" x="2376" y="-1576.5" font-size="0.6em" fill="#000000">Mead</text>
<text text-anchor="start" x="2294" y="-1529" font-size="0.6em" fill="#696969">skos:definition</text>
<text text-anchor="start" x="2390.5" y="-1556.5" font-size="0.6em" fill="#000000">Mead is one of the oldest alcoholic beverages,</text>
<text text-anchor="start" x="2376" y="-1545.5" font-size="0.6em" fill="#000000">produced by fermenting honey (although some other</text>
<text text-anchor="start" x="2392" y="-1534.5" font-size="0.6em" fill="#000000">ingredients like fruit can be added in as well).</text>
<text text-anchor="start" x="2383" y="-1523.5" font-size="0.6em" fill="#000000">The alcohol content usually ranges from 5 to 20%</text>
<text text-anchor="start" x="2393.5" y="-1512.5" font-size="0.6em" fill="#000000">and the flavor profile ranges from very dry to</text>
<text text-anchor="start" x="2476.5" y="-1501.5" font-size="0.6em" fill="#000000">very sweet.</text>
</g>

<g id="node317" class="node">
<title>https://rdf.ag/o/beer#Oktoberfestbier</title>
<polygon fill="none" stroke="#000000" points="1729.5,-4053.5 1729.5,-4084.5 2092.5,-4084.5 2092.5,-4053.5 1729.5,-4053.5"/>
<polygon fill="#d3d3d3" stroke="transparent" points="1732.5,-4056.5 1732.5,-4081.5 2089.5,-4081.5 2089.5,-4056.5 1732.5,-4056.5"/>
<text text-anchor="start" x="1765.5" y="-4066.5" font-size="0.6em" fill="#0000ff">Märzen Oktoberfest Beer</text>
<text text-anchor="start" x="1953.5" y="-4066.5" font-size="0.6em" fill="#000000">rdfs:Class, owl:Class</text>
<polygon fill="none" stroke="#000000" points="1729.5,-3775.5 1729.5,-4053.5 2092.5,-4053.5 2092.5,-3775.5 1729.5,-3775.5"/>
<text text-anchor="start" x="1739.5" y="-4026.5" font-size="0.6em" fill="#696969">foaf:name</text>
<text text-anchor="start" x="1821.5" y="-4026.5" font-size="0.6em" fill="#000000">Oktoberfest Beer</text>
<text text-anchor="start" x="1739.5" y="-3951.5" font-size="0.6em" fill="#696969">skos:definition</text>
<text text-anchor="start" x="1844.5" y="-4006.5" font-size="0.6em" fill="#000000">Märzen&#45;style beers are light lagers that are</text>
<text text-anchor="start" x="1821.5" y="-3995.5" font-size="0.6em" fill="#000000">typically brewed with Vienna, Munich and sometimes</text>
<text text-anchor="start" x="1825.5" y="-3984.5" font-size="0.6em" fill="#000000">Pilsner malts and traditional German hops with low</text>
<text text-anchor="start" x="1849" y="-3973.5" font-size="0.6em" fill="#000000">alpha acid contents such as Hallertau and</text>
<text text-anchor="start" x="1833" y="-3962.5" font-size="0.6em" fill="#000000">Tettnanger but can substituted with Mt. Hood or</text>
<text text-anchor="start" x="1833" y="-3951.5" font-size="0.6em" fill="#000000">Saaz. The aroma of Märzen is slightly bitter and</text>
<text text-anchor="start" x="1835" y="-3940.5" font-size="0.6em" fill="#000000">not overly hoppy so that the Vienna and Munich</text>
<text text-anchor="start" x="1845" y="-3929.5" font-size="0.6em" fill="#000000">malt flavor is more promenant. This beer is</text>
<text text-anchor="start" x="1857" y="-3918.5" font-size="0.6em" fill="#000000">typically higher in alcohol content than</text>
<text text-anchor="start" x="1828" y="-3907.5" font-size="0.6em" fill="#000000">traditional German lagers at around 5&#45;6% abv. The</text>
<text text-anchor="start" x="1860" y="-3896.5" font-size="0.6em" fill="#000000">aroma is comparable to Vienna lager.</text>
<text text-anchor="start" x="1739.5" y="-3832.5" font-size="0.6em" fill="#696969">rdfs:comment</text>
<text text-anchor="start" x="1840" y="-3876.5" font-size="0.6em" fill="#000000">According to German Law, Oktoberfestbier is</text>
<text text-anchor="start" x="1838" y="-3865.5" font-size="0.6em" fill="#000000">legally reserved for the six breweries who are</text>
<text text-anchor="start" x="1849.5" y="-3854.5" font-size="0.6em" fill="#000000">allowed to serve their beer at the Munich</text>
<text text-anchor="start" x="1841.5" y="-3843.5" font-size="0.6em" fill="#000000">Oktoberfest. Those brewers are: Augustiner,</text>
<text text-anchor="start" x="1821.5" y="-3832.5" font-size="0.6em" fill="#000000">Hacker&#45;Pschorr, Hofbräuhaus, Löwenbräu, Paulaner,</text>
<text text-anchor="start" x="1823.5" y="-3821.5" font-size="0.6em" fill="#000000">and Spaten. However, German Law does not extend</text>
<text text-anchor="start" x="1866" y="-3810.5" font-size="0.6em" fill="#000000">beyond the German borders so the</text>
<text text-anchor="start" x="1833" y="-3799.5" font-size="0.6em" fill="#000000">märzen/oktoberfest is used as a label for a beer</text>
<text text-anchor="start" x="1828.5" y="-3788.5" font-size="0.6em" fill="#000000">style elsewhere, particulary among craft brewers.</text>
</g>

<polygon fill="none" stroke="#000000" points="2296,-2314.5 2296,-2462.5 2633,-2462.5 2633,-2314.5 2296,-2314.5"/>
<text text-anchor="start" x="2306" y="-2391.5" font-size="0.6em" fill="#696969">skos:definition</text>
<text text-anchor="start" x="2399.5" y="-2435.5" font-size="0.6em" fill="#000000">Lagers are fermented with the yeast strain</text>
<text text-anchor="start" x="2397.5" y="-2424.5" font-size="0.6em" fill="#000000">Saccharomyces pastorianus, which typically</text>
<text text-anchor="start" x="2390.5" y="-2413.5" font-size="0.6em" fill="#000000">ferments better in colder temperatures 7&#45;13˚C</text>
<text text-anchor="start" x="2433.5" y="-2402.5" font-size="0.6em" fill="#000000">(45&#45;55˚F) than S. cerevisiae. </text>
<text text-anchor="start" x="2418" y="-2391.5" font-size="0.6em" fill="#000000">Lagers are also known for having a</text>
<text text-anchor="start" x="2388" y="-2380.5" font-size="0.6em" fill="#000000">cold&#45;conditioning phase of the brewing process,</text>
<text text-anchor="start" x="2392.5" y="-2369.5" font-size="0.6em" fill="#000000">although not all lagers go through this phase. </text>
<text text-anchor="start" x="2415" y="-2358.5" font-size="0.6em" fill="#000000"> Lagers can be pale yellow, amber or</text>
<text text-anchor="start" x="2492.5" y="-2347.5" font-size="0.6em" fill="#000000">dark.</text>
<text text-anchor="start" x="2306" y="-2327.5" font-size="0.6em" fill="#696969">foaf:name</text>
<text text-anchor="start" x="2388" y="-2327.5" font-size="0.6em" fill="#000000">Lager</text>
</g>

<text text-anchor="start" x="2442.5" y="-2771.5" font-size="0.6em" fill="#0000ff">Mashing</text>
<polygon fill="none" stroke="#000000" points="2284,-2652.5 2284,-2758.5 2644,-2758.5 2644,-2652.5 2284,-2652.5"/>
<text text-anchor="start" x="2294" y="-2698.5" font-size="0.6em" fill="#696969">skos:definition</text>
<text text-anchor="start" x="2386" y="-2731.5" font-size="0.6em" fill="#000000">Similar to producing tea from tea leaves, wort is</text>
<text text-anchor="start" x="2387.5" y="-2720.5" font-size="0.6em" fill="#000000">produced by allowing the the grist to steep. It is</text>
<text text-anchor="start" x="2388" y="-2709.5" font-size="0.6em" fill="#000000">at this stage the the enzymes, mainly alpha and</text>
<text text-anchor="start" x="2406" y="-2698.5" font-size="0.6em" fill="#000000">beta amylase, in the malt are activated. </text>
<text text-anchor="start" x="2418.5" y="-2687.5" font-size="0.6em" fill="#000000"> It is at this stage that the enzymes</text>
<text text-anchor="start" x="2389" y="-2676.5" font-size="0.6em" fill="#000000">convert starch into sugar, which can be then be</text>
<text text-anchor="start" x="2376" y="-2665.5" font-size="0.6em" fill="#000000">consumed by yeast during the fermentation process.</text>
</g>

<g id="node600" class="node">
<title>https://rdf.ag/o/beer#TraditionalOktoberfestbier</title>
<polygon fill="none" stroke="#000000" points="1714.5,-3633.5 1714.5,-3664.5 2107.5,-3664.5 2107.5,-3633.5 1714.5,-3633.5"/>
<polygon fill="#d3d3d3" stroke="transparent" points="1717.5,-3636.5 1717.5,-3661.5 2104.5,-3661.5 2104.5,-3636.5 1717.5,-3636.5"/>
<text text-anchor="start" x="1724.5" y="-3646.5" font-size="0.6em" fill="#0000ff">Traditional Märzenbier Traditional Oktoberfest Beer</text>
<text text-anchor="start" x="1994.5" y="-3646.5" font-size="0.6em" fill="#000000">owl:Class, rdfs:Class</text>
<polygon fill="none" stroke="#000000" points="1714.5,-3300.5 1714.5,-3633.5 2107.5,-3633.5 2107.5,-3300.5 1714.5,-3300.5"/>
<text text-anchor="start" x="1724.5" y="-3606.5" font-size="0.6em" fill="#696969">foaf:name</text>
<text text-anchor="start" x="1817.5" y="-3606.5" font-size="0.6em" fill="#000000">Traditional Oktoberfest Beer</text>
<text text-anchor="start" x="1724.5" y="-3542.5" font-size="0.6em" fill="#696969">rdfs:comment</text>
<text text-anchor="start" x="1836" y="-3586.5" font-size="0.6em" fill="#000000">According to German Law, Oktoberfestbier is</text>
<text text-anchor="start" x="1834" y="-3575.5" font-size="0.6em" fill="#000000">legally reserved for the six breweries who are</text>
<text text-anchor="start" x="1845.5" y="-3564.5" font-size="0.6em" fill="#000000">allowed to serve their beer at the Munich</text>
<text text-anchor="start" x="1837.5" y="-3553.5" font-size="0.6em" fill="#000000">Oktoberfest. Those brewers are: Augustiner,</text>
<text text-anchor="start" x="1817.5" y="-3542.5" font-size="0.6em" fill="#000000">Hacker&#45;Pschorr, Hofbräuhaus, Löwenbräu, Paulaner,</text>
<text text-anchor="start" x="1819.5" y="-3531.5" font-size="0.6em" fill="#000000">and Spaten. However, German Law does not extend</text>
<text text-anchor="start" x="1862" y="-3520.5" font-size="0.6em" fill="#000000">beyond the German borders so the</text>
<text text-anchor="start" x="1829" y="-3509.5" font-size="0.6em" fill="#000000">märzen/oktoberfest is used as a label for a beer</text>
<text text-anchor="start" x="1824.5" y="-3498.5" font-size="0.6em" fill="#000000">style elsewhere, particulary among craft brewers.</text>
<text text-anchor="start" x="1724.5" y="-3396" font-size="0.6em" fill="#696969">skos:definition</text>
<text text-anchor="start" x="1843" y="-3478.5" font-size="0.6em" fill="#000000">Historically, this style of beer was brewed in</text>
<text text-anchor="start" x="1817.5" y="-3467.5" font-size="0.6em" fill="#000000">March, hence the Märzen meaning &#39;March&#39; in German.</text>
<text text-anchor="start" x="1836" y="-3456.5" font-size="0.6em" fill="#000000">Due to the lack of refrigeration at the time, the</text>
<text text-anchor="start" x="1827" y="-3445.5" font-size="0.6em" fill="#000000">Bavarian Duke Albrecht V decreed that no brewing</text>
<text text-anchor="start" x="1826" y="-3434.5" font-size="0.6em" fill="#000000">should occur between April 23 and September 29th</text>
<text text-anchor="start" x="1827" y="-3423.5" font-size="0.6em" fill="#000000">to reduce beer spoilage. Therefore the beers were</text>
<text text-anchor="start" x="1834.5" y="-3412.5" font-size="0.6em" fill="#000000">brewed in March and lagered (stored cool) until</text>
<text text-anchor="start" x="1825.5" y="-3401.5" font-size="0.6em" fill="#000000">Oktoberfest. Traditionally these beers were darker</text>
<text text-anchor="start" x="1831" y="-3390.5" font-size="0.6em" fill="#000000">but have now become increasing lighter to match</text>
<text text-anchor="start" x="1833.5" y="-3379.5" font-size="0.6em" fill="#000000">modern tastes. The first lager that was officially</text>
<text text-anchor="start" x="1832" y="-3368.5" font-size="0.6em" fill="#000000">labelled &#39;Märzenbier&#39; was brewed in 1841 by the</text>
<text text-anchor="start" x="1830" y="-3357.5" font-size="0.6em" fill="#000000">Spaten Brewery of Munich and was introduced at</text>
<text text-anchor="start" x="1833.5" y="-3346.5" font-size="0.6em" fill="#000000">that year&#39;s Oktoberfest. In 1872 Spaten was the</text>
<text text-anchor="start" x="1854" y="-3335.5" font-size="0.6em" fill="#000000">first to label their märzen&#45;style lager as</text>
<text text-anchor="start" x="1828" y="-3324.5" font-size="0.6em" fill="#000000">Oktoberfestbier, and the recipe Spaten uses today</text>
<text text-anchor="start" x="1841" y="-3313.5" font-size="0.6em" fill="#000000">is still largely based on the one used in 1872.</text>
</g>

<text text-anchor="start" x="2389.5" y="-4194.5" font-size="0.6em" fill="#000000">beer with a base of barley. Barley wines have a</text>
<text text-anchor="start" x="2389" y="-4183.5" font-size="0.6em" fill="#000000">much higher alcohol content than typical beers.</text>
<text text-anchor="start" x="2307" y="-4163.5" font-size="0.6em" fill="#696969">foaf:name</text>
<text text-anchor="start" x="2389" y="-4163.5" font-size="0.6em" fill="#000000">Barley Wine</text>
</g>

<text text-anchor="start" x="49.5" y="-5855.5" font-size="0.6em" fill="#696969">foaf:name</text>
<text text-anchor="start" x="131.5" y="-5855.5" font-size="0.6em" fill="#000000">India Pale Ale</text>
<text text-anchor="start" x="49.5" y="-5802.5" font-size="0.6em" fill="#696969">skos:definition</text>
<text text-anchor="start" x="131.5" y="-5835.5" font-size="0.6em" fill="#000000">India Pale Ale is actually a type of pale ale that</text>
<text text-anchor="start" x="132.5" y="-5824.5" font-size="0.6em" fill="#000000">is brewed in the &quot;English&quot; style, contrary to its</text>
<text text-anchor="start" x="136" y="-5813.5" font-size="0.6em" fill="#000000">name. It was originally brewed for the Indian</text>
<text text-anchor="start" x="143" y="-5802.5" font-size="0.6em" fill="#000000">market which is where it got its name. It&#39;s</text>
<text text-anchor="start" x="141.5" y="-5791.5" font-size="0.6em" fill="#000000">origins are still debated to this day but this</text>
<text text-anchor="start" x="136.5" y="-5780.5" font-size="0.6em" fill="#000000">beer is known for its use of English hops and</text>
<text text-anchor="start" x="232" y="-5769.5" font-size="0.6em" fill="#000000">yeast.</text>
</g>

<text text-anchor="start" x="2297" y="-993" font-size="0.6em" fill="#696969">skos:definition</text>
<text text-anchor="start" x="2379" y="-998.5" font-size="0.6em" fill="#000000">Cider is made from fermenting the juice of crushed</text>
<text text-anchor="start" x="2455" y="-987.5" font-size="0.6em" fill="#000000">fruit, usually apples.</text>
<text text-anchor="start" x="2297" y="-940" font-size="0.6em" fill="#696969">rdfs:comment</text>
<text text-anchor="start" x="2379" y="-967.5" font-size="0.6em" fill="#000000">In North America, particularly the US, cider is an</text>
<text text-anchor="start" x="2383.5" y="-956.5" font-size="0.6em" fill="#000000">unfermented beverage produced from crushing</text>
<text text-anchor="start" x="2397" y="-945.5" font-size="0.6em" fill="#000000">apples, but can be made from other fruit. </text>
<text text-anchor="start" x="2406" y="-934.5" font-size="0.6em" fill="#000000"> While fermented crushed fruit (cider)</text>
<text text-anchor="start" x="2391" y="-923.5" font-size="0.6em" fill="#000000">is not a type of beer this class is in the Beer</text>
<text text-anchor="start" x="2435" y="-912.5" font-size="0.6em" fill="#000000">Ontology for convenience.</text>
<text text-anchor="start" x="2297" y="-892.5" font-size="0.6em" fill="#696969">foaf:name</text>
<text text-anchor="start" x="2379" y="-892.5" font-size="0.6em" fill="#000000">Cider</text>
</g>

<g id="node832" class="node">
<title>https://rdf.ag/o/beer#brewedBy</title>
<polygon fill="none" stroke="#000000" points="2289,-283.5 2289,-314.5 2639,-314.5 2639,-283.5 2289,-283.5"/>
<polygon fill="#d3d3d3" stroke="transparent" points="2292,-286.5 2292,-311.5 2636,-311.5 2636,-286.5 2292,-286.5"/>
<text text-anchor="start" x="2342" y="-296.5" font-size="0.6em" fill="#0000ff">Brewed By</text>
<text text-anchor="start" x="2492" y="-296.5" font-size="0.6em" fill="#000000">owl:objectProperty</text>
<polygon fill="none" stroke="#000000" points="2289,-71.5 2289,-283.5 2639,-283.5 2639,-71.5 2289,-71.5"/>
<text text-anchor="start" x="2299" y="-223.5" font-size="0.6em" fill="#696969">rdfs:comment</text>
<text text-anchor="start" x="2381.5" y="-256.5" font-size="0.6em" fill="#000000">Cette propriété est probablement la moins définie</text>
<text text-anchor="start" x="2410.5" y="-245.5" font-size="0.6em" fill="#000000">dans cette ontologie. Bien que flexible</text>
<text text-anchor="start" x="2381" y="-234.5" font-size="0.6em" fill="#000000">ontologiquement avec une equivalence à plusieurs</text>
<text text-anchor="start" x="2394" y="-223.5" font-size="0.6em" fill="#000000">cas et vocabulaires, elle est conçu comme un</text>
<text text-anchor="start" x="2392.5" y="-212.5" font-size="0.6em" fill="#000000">fourre&#45;tout pour les situations où une relation</text>
<text text-anchor="start" x="2396" y="-201.5" font-size="0.6em" fill="#000000">&quot;bon sens&quot; exister sans être immédiatement</text>
<text text-anchor="start" x="2482" y="-190.5" font-size="0.6em" fill="#000000">évidente.</text>
<text text-anchor="start" x="2299" y="-143" font-size="0.6em" fill="#696969">rdfs:comment</text>
<text text-anchor="start" x="2384" y="-170.5" font-size="0.6em" fill="#000000">This is likely the least defined property within</text>
<text text-anchor="start" x="2386" y="-159.5" font-size="0.6em" fill="#000000">this ontology. While ontologically flexible to a</text>
<text text-anchor="start" x="2381" y="-148.5" font-size="0.6em" fill="#000000">number of different vocabulary, it is meant as a</text>
<text text-anchor="start" x="2382.5" y="-137.5" font-size="0.6em" fill="#000000">catch&#45;all for situations where a common sense</text>
<text text-anchor="start" x="2385.5" y="-126.5" font-size="0.6em" fill="#000000">relationship is known to exist while not being</text>
<text text-anchor="start" x="2448" y="-115.5" font-size="0.6em" fill="#000000">immediatly obvious.</text>
<text text-anchor="start" x="2299" y="-90" font-size="0.6em" fill="#696969">skos:definition</text>
<text text-anchor="start" x="2381" y="-95.5" font-size="0.6em" fill="#000000">The brewery that is marketing or physically</text>
<text text-anchor="start" x="2444.5" y="-84.5" font-size="0.6em" fill="#000000">brewing the beer.</text>
</g>

<polygon fill="none" stroke="#000000" points="554,-8263.5 554,-8294.5 918,-8294.5 918,-8263.5 554,-8263.5"/>

<text text-anchor="start" x="609" y="-8276.5" font-size="0.6em" fill="#0000ff">Milk Stout</text>
<text text-anchor="start" x="760" y="-8276.5" font-size="0.6em" fill="#000000">owl:Class, rdfs:Class</text>
<polygon fill="none" stroke="#000000" points="554,-8053.5 554,-8263.5 918,-8263.5 918,-8053.5 554,-8053.5"/>
<text text-anchor="start" x="564" y="-8214.5" font-size="0.6em" fill="#696969">skos:historyNote</text>
<text text-anchor="start" x="673.5" y="-8236.5" font-size="0.6em" fill="#000000">In the United Kingdom, the Food Labelling</text>
<text text-anchor="start" x="657" y="-8225.5" font-size="0.6em" fill="#000000">Regulations of 1996 state that milk stouts cannot</text>
<text text-anchor="start" x="660" y="-8214.5" font-size="0.6em" fill="#000000">be described as containing &#39;milk&#39;, since the milk</text>
<text text-anchor="start" x="666" y="-8203.5" font-size="0.6em" fill="#000000">nutrients are destroyed or transformed in the</text>
<text text-anchor="start" x="666.5" y="-8192.5" font-size="0.6em" fill="#000000">brewing process and what is left is not &#39;milk&#39;.</text>
<text text-anchor="start" x="564" y="-8161.5" font-size="0.6em" fill="#696969">skos:definition</text>
<text text-anchor="start" x="657" y="-8172.5" font-size="0.6em" fill="#000000">Milk stouts are a type of stouts that have been</text>
<text text-anchor="start" x="669.5" y="-8161.5" font-size="0.6em" fill="#000000">sweetened by the addition of milk or milk</text>
<text text-anchor="start" x="748.5" y="-8150.5" font-size="0.6em" fill="#000000">products.</text>
<text text-anchor="start" x="564" y="-8130.5" font-size="0.6em" fill="#696969">foaf:name</text>
<text text-anchor="start" x="657" y="-8130.5" font-size="0.6em" fill="#000000">Milk Stout</text>
<text text-anchor="start" x="564" y="-8088.5" font-size="0.6em" fill="#696969">rdfs:comment</text>
<text text-anchor="start" x="663" y="-8110.5" font-size="0.6em" fill="#000000">Any stouts that that use milk or any milk product</text>
<text text-anchor="start" x="676.5" y="-8099.5" font-size="0.6em" fill="#000000">as an ingredient is an instance of this class</text>
<text text-anchor="start" x="657" y="-8088.5" font-size="0.6em" fill="#000000">despite the UK Food Labelling Regulations of 1996</text>
<text text-anchor="start" x="682" y="-8077.5" font-size="0.6em" fill="#000000">to ensure that consumers are aware of a</text>
<text text-anchor="start" x="699" y="-8066.5" font-size="0.6em" fill="#000000">possibility of lactose in their beer.</text>
</g>

<text text-anchor="start" x="1930.5" y="-5352.5" font-size="0.6em" fill="#000000">rdfs:Class, owl:Class</text>
<polygon fill="none" stroke="#000000" points="1729.5,-5191.5 1729.5,-5339.5 2092.5,-5339.5 2092.5,-5191.5 1729.5,-5191.5"/>

<text text-anchor="start" x="1821.5" y="-5312.5" font-size="0.6em" fill="#000000">Saison</text>
<text text-anchor="start" x="1739.5" y="-5248.5" font-size="0.6em" fill="#696969">skos:definition</text>
<text text-anchor="start" x="1828.5" y="-5292.5" font-size="0.6em" fill="#000000">Saison beers are seasonal beers that are typically</text>
<text text-anchor="start" x="1846" y="-5281.5" font-size="0.6em" fill="#000000">enjoyed during the summer until the end of</text>
<text text-anchor="start" x="1843.5" y="-5270.5" font-size="0.6em" fill="#000000">harvest. There are a wide variety of saisons</text>
<text text-anchor="start" x="1833.5" y="-5259.5" font-size="0.6em" fill="#000000">brewed in the fasion as choosen at the brewer&#39;s</text>
<text text-anchor="start" x="1844.5" y="-5248.5" font-size="0.6em" fill="#000000">discretion. Saisons are typically fruitier and</text>
<text text-anchor="start" x="1830.5" y="-5237.5" font-size="0.6em" fill="#000000">lower in alcohol content than typical beers. While</text>
<text text-anchor="start" x="1830" y="-5226.5" font-size="0.6em" fill="#000000">saisons originated in Belgium, there is increasing</text>
<text text-anchor="start" x="1821.5" y="-5215.5" font-size="0.6em" fill="#000000">popularity among American craft brewers to produce</text>
<text text-anchor="start" x="1907" y="-5204.5" font-size="0.6em" fill="#000000">their own saisons.</text>
</g>
